[111, "Christians on Campus",	"Cultural and Religious",	"MLK Library/Student Union",	4,	0,	130,	True,	"Christians on Campus are believers in Christ from various backgrounds. We love the Lord Jesus Christ and endeavor to give Him the first place in all things (Col. 1:18). Our desire is to cooperate with Him for the accomplishment of God's eternal purpose (Eph. 3:11) by ministering the unsearchable riches of Christ (Eph. 3:8) for the building up of the Body of Christ (Eph. 4:12).",	"Geoffry Banuelos", ""],
[112, "Circle K International (CKI) at San Jose State University",	"Special Interest",	"NA",	3,	0,	78,	True,	"Circle K International is the largest collegiate community service, leadership development, and friendship organization in the world. Circle K clubs are organized and sponsored by a Kiwanis club on a college or university campus. It is a self-governing organization and elects its own officers, conducts its own meetings, and determines its own service activities. This high degree of autonomy allows for a unique service experience driven entirely by the members for the members. Circle K blends community service and leadership training with the opportunity to meet many other college students at service projects, conferences, and conventions and form genuine lifelong friendships with people of all walks of life. Ultimately, Circle K encompasses a defining and meaningful opportunity during one's collegiate career.",	"Mark Catolos", ""],
