[114, "Cleaner San Jose ",	"Academic",	"NA",	3,	2,	115,	True,	"We, Cleaner San Jose, also known as CSJ, believes in a cleaner community is a stronger community. Therefore, CSJ vision and purpose shall be to provide its members with increased knowledge of current social issue in the City of San Jose. Our mission is to build awareness in addition to perform community related service for a better San Jose.",	"Eric Truong", ""],
[115, "Climbing Club ",	"Club Sports",	"Off Campus",	2,	1,	32,	False,	"The main object of the Spartan Climbing club is to introduce aspects of mountaineering to the students and faculty of SJSU. Creating a community for all amateur and veterans alike. Planning events for outdoor climbing, camping and adventure!",	"Brandon Tarter", ""],
[116, "Club Tennis Team ",	"Club Sports",	"Off Campus",	4,	1,	90,	False,	"The Club Tennis Team is an organization through SJSU's Club Sports program who play both casually and competitively among ourselves and soon at the intercollegiate level.",	"Willem Poldervaart", ""],
[117, "Club Volleyball",	"Club Sports",	"YUH ",	4,	3,	65,	False,	"The club is designed to serve as a base for students to meet people who share the same interest in volleyball, both within SJSU and throughout California. This club also brings students together to form a team and family that creates a fun and competitive atmosphere for those involved.",	"Christian Selwan", ""],
[118, "Coaching Corps at SJSU",	"Special Interest",	"NA",	1,	1,	97,	True,	"The purpose of Coaching Corps is to promote students to become an influential role model for disadvantaged youth through sports. The power of a coach is like a mentor and motivator to encourage kids to get involved with sports while providing them with a healthy life. Coaching Corps is an organization on campus that strives to positively affect the lives of as many local, under-served youth as possible. Please join us in our mission to close the sports gap in the heart of Silicon Valley.",	"Amber Mckenzie", ""],
[119, "Colony of Alpha Omega Epsilon at San Jose State University",	"Academic",	"NA",	2,	1,	95,	True,	"Colony of Alpha Omega Epsilon at San Jose State University is a club focus in promote friendship, leadership, and professionalism to all members of the organization. The club has a purpose of supporting women that are engineering and science majors. ",	"Isadora McCullough", ""],
[120, "COMM Network",	"Academic",	"NA",	5,	2,	111,	False,	"Our mission is to promote professional experience and training in the use of new media and social media in service to the Department of Communication Studies and its students, alumni and faculty. ",	"Edwin Lee", ""],
[121, "Competitive Dance Club",	"Club Sports",	"NA",	5,	2,	113,	False,	"This organization was created to become a competitive dance team that is primarily jazz-based. Members will create a positive representation of San Jose State University in the competitive dance world, gain choreographic and technical skills, understanding of what it means to be a positive and respectful team member, achieve networking opportunities, and a sense of community thru the competitive dance world as well as within the organization itself.",	"Megan Stagi", ""],
[122, "Concrete Canoe Team at San Jose State University",	"Academic",	"Off Campus",	5,	3,	119,	False,	"Civil engineering students from universities around the country participate in what is known as the Concrete Canoe competition. This competition, hosted and directed by the American Society of Civil Engineers (ASCE), gives students a chance to demonstrate their engineeirng, athletic and artistic skills on a regional and national level. Teams must design and build their own canoe out of concrete and race it against other schools in their respected regions. The two top two schools from each region compete at the national level at a specified date and location. Teams are graded based on racing performance, presentation, design paper and final product. Each is worth 25% of the final score. This competition allows engineering students to use their knowledge to create a tangible piece of engineering. The concrete canoe competition is one of the most rewarding experiences engineers can participate in.",	"Benjamin Klemme", ""],
[123, "COOP SJSU",	"Special Interest",	"NA",	3,	0,	135,	False,	"We, the members of COOP, promote a just, verdant and peaceful environment for all. We seek to provide students in all disciplines a real world opportunity to address social problems in our community by collaborating with various, state, county, local associations, and organizations. By doing so, we promote educational, social, and cultural opportunities to students and to society as a whole. We are to participate in the University Community, and discharge authority vested in the Association by the State of California and the President of the University, do hereby declare that equal opportunities shall be afforded to all students without regard to race, religion, creed, gender, sexual or affectional preference, age, ethnic origin, nationality, physical disability, or any other basis protected by law.",	"Laura Marie Cayabyab", ""],
[124, "COUGH at SJSU",	"Special Interest",	"NA",	2,	1,	147,	False,	"This organization was formed to further enhance the knowledge and affects of tobacco use on college campuses, specifically San Jose State University, continue the efforts to strengthen the current smoking policy at San Jose State University and raise awareness on the issues related to tobacco use on personal, community, and environmental health. This organization will also help those students interested in seeking cessation assistance on campus.",	"Christy Lam", ""],
[125, "Counselor Ed Graduate Organization (CEGO)",	"Academic",	"NA",	2,	0,	100,	False,	"The purpose of this club shall be to create an inclusive community for students studying in the Counselor Education department of the Connie L. Lurie College of Education by providing networking opportunities, practical experiences, and a space to voice opinions",	"Toni Bravo", ""],
[126, "Cru",	"Cultural and Religious",	"Off Campus",	5,	1,	135,	True,	"Our purpose is to build a movement of people who are transformed by Jesus Christ. To be a movement that seeks to introduce students to Jesus Christ, help them to grow in their faith, encourage them to live life passionately under the lordship of Christ, and inspire commitment to advancing the purposes of God in the world. We seek to answer the big questions in life and enjoy community with one another.",	"Marla Strong", ""],
[127, "D.R.E.A.M. Campus Ministry",	"Cultural and Religious",	"NA",	2,	2,	44,	False,	" Our group is devoted to students who are seeking to get involved on campus and create an impact that will ripple throughout the generations to come. We want to provide means to accommodate students in their spiritual walk as well as their educational goals throughout their time here at San Jose State! This is done through mentor programs as well as faith building events and activities that include weekly bible discussions as well as other activities.",	"Israel Escobar", ""],
[128, "DBF Hardware",	"Academic",	"NA",	3,	1,	82,	True,	"The main purpose of this organization is to facilitate the involvement of aerospace engineering students in American Institute of Aeronautics and Astronautics (AIAA) Design Build Fly (DBF) competition in April 2017. The club members are designing and manufacturing the entire UAV (Unmanned Aerial Vehicle) to compete against other universities at international level.",	"Fny Samneet Singh", ""],
