[130, "Delta Gamma",	"Fraternity/Sorority",	"360 East Reed Street, San José CA  95112",	1,	0,	124,	False,	"Delta Gamma offers to women of all ages a rich heritage based on principles of personal integrity, personal responsibility and intellectual honesty. Its primary purpose is to foster high ideals of friendship, promote educational and cultural interests, create a true sense of social responsibility, and develop the finest qualities of character.",	"Madison Feld", ""],
[131, "Delta Sigma Phi Fraternity",	"Fraternity/Sorority",	"189 S 11th Street, San Jose CA",	3,	3,	69,	True,	"The purpose of Delta Sigma Phi Fraternity Gamma Epsilon Chapter shall be to challenge each man to a greater good and to be a better man. All Chapter activities and operations shall support member's pursuit of this purpose.",	"Royce Stanfill", ""],
[132, "Delta Sigma Pi",	"Academic",	"Student Union",	2,	1,	101,	False,	"Delta Sigma Pi is a professional fraternity organized to foster the study of business in universities; to encourage scholarship, social activity and the association of students for their mutual advancement by research and practice; to promote closer affiliation between the commercial world and students of commerce, and to further a higher standard of commercial ethics and culture and the civic and commercial welfare of the community.",	"Ujwal Battar", ""],
[133, "Delta Sigma Theta Sorority, Inc./ Eta Omega Chapter",	"Fraternity/Sorority",	"NA",	5,	0,	112,	True,	" Sorority Summary/Information: Delta Sigma Theta Sorority, Inc. was founded January 13, 1913 at Howard University by 22 industrious college women. Eta Omega Chapter was Chartered in November of 1970 at San Jos_ State University by four women: Cheryl Dunlap, Jocelyn Larrimore, Virginia Roberts, and Veronica Tyler. Since its chartering, Eta Omega has emphasized Delta principles of sisterhood and public service. We have dedicated ourselves in projects such as: May Week, Canned Food Drive Drives, Breast Cancer and Aids awareness walks, Annual Soul Food Social and much more. We also assist the San Jose Alumnae Chapter in many of their service projects. Chapter History: A wide range of programs addressing health, education, international involvement, and the strengthening of the African American family have emerged and evolved over the years. In realizing its mission, Delta Sigma Theta provides an extensive array of public service through its Five-Point Program Thrust of: Physical and Mental Health, Educational Development, Economic Development, International Awareness and Involvement, and Political Awareness and Involvement. Message from the President: Greetings, As President of Delta Sigma Theta Sorority, Inc. Eta Omega Chapter at SJSU I would like to welcome you to Greek Life and the brief insight of DST's Eta Omega Chapter here at SJSU. Our mission at SJSU, and in the community, is to reach out and continue the legacy that our Sororities founders set forth for us. In every event and program we bring forth, we focus on our Sororities Five-Point Thrust: Economic Development Educational Development International Awareness and Involvement Physical and Mental Health Political Awareness and Involvement. We look forward to see and hopefully working with you all this academic school year. Lula Berhe President of Delta Sigma Theta Sorority, Inc. Eta Omega Chapter Annual Events: May Week-the 1st or 2nd week of May Soul Food Social-February Greek Myths-September AIDS Walk-SJ and SF Breast Cancer Walk-SJ Canned Food Drive-November Christmas in the Park-December Walk for Water with Alumni Chapter-May Girl Talk-April ",	"Kenyatta Yarn", ""],
[134, "Delta Upsilon Fraternity",	"Fraternity/Sorority",	"201 South 11th Street, San José CA 95112",	1,	0,	45,	False,	"Delta Upsilon is the premier men's fraternity committed to Building Better Men for a global society through service, leadership development, and lifelong personal growth of our diverse membership.",	"Eli Kolach", ""],
[135, "Delta Zeta Sorority",	"Fraternity/Sorority",	"148 South 11th Street, San José CA  95112",	5,	3,	148,	False,	"The purpose of this sorority shall be to unite its members in the bonds of sincere and lasting friendship, to stimulate one another in the pursuit of knowledge, to promote the moral and social culture of its members, and to develop plans for guidance and unity in action; objects worthy of the highest aim and purpose of associated effort.",	"Talia Cabrera", ""],
[136, "Desert Dwellers ",	"Special Interest",	"NA",	3,	0,	95,	True,	"The Desert Dwellers club is composed of people who have an affinity for the desert's inherent beauty and serenity. The club will focus on how to design, build and create a sustainable lifestyle and community within the desert. Using models, research and experimenting; the club will determine the best and most resourceful way to thrive in the inhospitable environment that is the high desert. ",	"Kaylan Hager", ""],
[137, "Design for America (DFA) ",	"Special Interest",	"NA",	3,	3,	130,	True,	"San Jose State University is a highly diverse school bringing students from all economic and cultural backgrounds into the workforce in one of the most profitable, innovative and progressive areas in the country. As the world is becoming increasingly connected and collaborative, we must give as many students the chance to learn and grow their own voice as well as the tools to bring their own visions into reality. Facing the increasingly complex problems of our time, Human Centered Design offers a direct route to solutions that affect real change and solve important issues. We aim to educate, research, and apply our collective knowledge to propel change in our local communities.",	"Federico Miller", ""],
[138, "Design Studies Club (DSC) ",	"Academic",	"NA",	3,	1,	115,	False,	"The purpose of this club is to provide resources to the B.A Design Studies majors, concentrating in Graphic Design, Interior Design, Industrial Design, and Animation/Illustration. We want to connect these students to internship/job opportunities, conduct and facilitate career workshops, encourage cross-collaboration in skill sets, and build a network for students and alumni. This is a safe and nonjudgmental environment where B.A Design Studies majors can feel appreciated and assisted. ",	"Katie Anderson", ""],
[139, "Destino",	"Cultural and Religious",	"NA",	4,	1,	39,	True,	"We are a faith-based community where students can come and investigate who God is, who Jesus is, and answer some of life's big questions. We do all of this through the Latino community and culture.",	"Jasmine Rios", ""],
[140, "El Espartano Noticias | Periodistas Latinos en SJSU",	"Academic",	"NA",	2,	1,	124,	True,	" El Espartano Noticias is committed in informing the Spanish-speaking community at San Jose State University by covering the latest news. The news organization provides extensive coverage including articles and videos about social justice issues, technology, health, and sports all completely in Spanish. Stay well informed with our team! ",	"Itzel Castro", ""],
