[147, "Film Production Society ",	"Special Interest",	"NA",	4,	0,	45,	False,	"Film Production Society strives to provide opportunities for San Jose State students to learn from and interact with those in the film community by having workshops and official FPS student run productions two to three times a year.",	"Ashley Valenzuela", ""],
[148, "Food Journalism",	"Special Interest",	"NA",	3,	0,	46,	True,	"The purpose of Food Journalism is to embrace the food and restaurants in the Bay Area to gain a greater appreciation for culture and to understand how food coincides with culture. Food is an experience that brings people together and after each outing, we will be writing a critique and review of the restaurant to be shared with San Jos_ State students. Our purpose in doing so is to collectively offer students suggestions for good food and restaurants in the area. We will also be promoting healthy food alternatives and will strive to bring students better access to healthier, more affordable eating. ",	"Zirui Deng", ""],
[149, "Forensic Science Students ",	"Special Interest",	"MQH 520",	4,	0,	67,	False,	"For the purpose of providing a forum for forensic science students to exchange information on course work, scholarships and to promote mentoring. We also facilitate contacts within the forensic science community in order to provide internships, guest speakers and future job opportunities.",	"Madison McGowan", ""],
[150, "Formula SAE",	"Academic",	"NA",	1,	1,	150,	False,	"To provide assistance to students. ",	"Michael Jarrett", ""],
[151, "Four Corners",	"Cultural and Religious",	"NA",	1,	3,	80,	True,	"As we take the 4 Corners Christian Fellowship of a square inwards and bring them together, it takes on a new shape. The mission of 4 Corners Christian Fellowship is to bring together students from the corners of the world to increase our understanding of the Christian faith and increase our engagement with the world as future leaders. We believe that this mission works alongside the University's strategic plan and commitment to serve as fertile ground for a diverse and well-informed citizenry in the 21st century. It is the goal of 4 Corners Christian Fellowship to insure that its members develop a rich intellectual and philosophical basis for the Christian faith, resulting in a deeper appreciation of their own culture as well as that of others. It is our hope that our member's experience in 4 Corners Christian Fellowship will provide them with the basis for fairness and open-mindedness beyond their university years that will create synergies that will impact our global community with compassion and selfless service. It is our vision to see students go on to become the future leaders in their own corner of the world.",	"Oscar Leung", ""],
[152, "Game Development Club",	"Special Interest",	"NA",	1,	2,	75,	False,	"The Game Development Club was created with the sole purpose of creating an environment for people to come together to learn how to develop games, meet others who enjoy developing games, and also play games for the purpose of researching ways to improve their own games. We provide many forms of inspiration and motivation for people to begin learning about game development regardless of if they had prior experience making games or not. 1. Set up competitions that create opportunities for people of different disciplines to come together and begin creating games. 2. Reach out to industry professionals that explain and elaborate on their experiences making games and also teach fundamental game making ideas. 3. Host events that help students network with their peers and professionals in the industry for the purpose of helping them form game making projects outside the club and get connected with jobs in the game industry. 4. Explore the art of game making and push video games as a form of Art.",	"Andrew Ajemian", ""],
[153, "Gente Unida",	"Cultural and Religious",	"NA",	5,	3,	126,	True,	"To create unity among all Latin@ organizations on campus. 2. To work together by having events that displays our culture and creates cultural awareness. 3. To provide opportunities for networking. 4. To establish a Familia on campus by supporting each other.",	"Marisol Espino Figueroa", ""],
[154, "Geography Club ",	"Academic",	"NA",	2,	3,	107,	False,	"The purpose of the Geography Club is to bring both faculty and students together to learn and explore further about the field of Geography. It is our goal to learn and explore through our numerous club meetings and club outings to museums and conferences. Through these actions we hope to create a welcoming and inclusive group that truly represents the ideals of the SJSU community. ",	"Hector Guardado"], "",
