[162, "Theta Chi Fraternity",	"Academic",	"123 South 11th Street ",	4,	2,	143,	False,	"We at Theta Chi strive to mold young college men into responsible, confident adults who are motivated, well-educated, and who possess leadership skills to become successful in all our endeavors. We do this through extracurricular activities such as community service and social events with other Greeks at our house. We also give our members the opportunity to take leadership roles within our fraternity to learn organization, self-confidence, and time management skills that are essential to have in life. ", "Eduardo Mercado", ""]
